var getLanguageLabel = async (langCode) => {
  const [realLangCode, script] = langCode.split("-");
  const scriptMapping = {
    latn: t2.direct("Latin").toString(),
    cyrl: t2.direct("Cyrillic").toString()
  };
  const language = languages.find((language2) => language2[0] === realLangCode);
  return language?.[1] ? `${language[1]}${script ? ` (${scriptMapping?.[script.toLowerCase()] ?? script})` : ""}` : langCode;
};
var filterLanguages = async (search) => {
  if (!search)
    return [];
  return languages.filter((language) => language[1].toLowerCase().includes(search.toLowerCase()));
};
var langCodesToObject = async (langCodes) => {
  const languages2 = {};
  for (const langCode of langCodes) {
    languages2[langCode] = await getLanguageLabel(langCode);
  }
  return languages2;
};
